import React from "react"
import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
  root: {
    display: 'inline-block',
    height: '100vh',
    width: '500px'
  },
  red: {
    background: "red",
  }
});

const Midbar = props => {
  const classes = useStyles()

  return (
    <div className={`${classes.root} ${classes.red}`}/>
  )
}

export default Midbar
